import React from 'react';
import { Provider } from 'react-native-paper';
import { Main } from './src';
import { NavigationContainer } from '@react-navigation/native';

export default function App() {
  return (
    <Provider>
      <NavigationContainer>
        <Main />
      </NavigationContainer>
    </Provider>
  );
}
